    false,nt"url": null,nt"notes": "NODC Accession 0112930 includes chemical,
    meteorological, physical and underway - surface data collected from SKOGAFOSS in
    the North Atlantic Ocean, North Greenland Sea and Stellwagen Bank National Marine
    Sanctuary from 2004-02-17 to 2005-01-06 and retrieved during cruise SKO402, SKO408,
    SKO409, SKO410, SKO411, SKO412, SKO413, SKO415 and SKO416. These data include ALKALINITY,
    BAROMETRIC PRESSURE, CARBON DIOXIDE - AIR, CARBON DIOXIDE - PARTIAL PRESSURE - DIFFERENCE,
    DISSOLVED INORGANIC CARBON, DISSOLVED OXYGEN, NITRATE, NITRITE, PHOSPHATE, Partial
    pressure (or fugacity) of carbon dioxide, SALINITY, SEA SURFACE TEMPERATURE, SILICATE
    and WATER TEMPERATURE. The instruments used to collect these data include Barometric
